import React from "react";
import { BrowserRouter,Route,Routes} from "react-router-dom";
import PrincipalPage from '../pages/PrincipalPage'


function Routers() {
    return (
      <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<PrincipalPage/>}/>
        </Routes>
      </BrowserRouter>
    );
  }

  export default Routers;
